import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Emulate a mobile device
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile_view.png'));

    // --- Open the mobile menu ---
    // The menu trigger is a div with class 'nav-menu' and text 'All'
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible', timeout: 5000 });
    await menuTrigger.click();

    // Wait for the menu overlay to become visible
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });

    // Take screenshot of the open menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // --- Verify a menu item and extract data ---
    const electronicsLink = page.locator('.mobile-menu a', { hasText: 'Electronics' });
    await electronicsLink.waitFor({ state: 'visible', timeout: 5000 });
    const isMenuOpen = await mobileMenuOverlay.isVisible();
    const electronicsLinkText = await electronicsLink.textContent();

    // --- Close the mobile menu ---
    const closeButton = page.locator('.mobile-menu .close-mobile-menu');
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // Wait for the menu overlay to be hidden
    await mobileMenuOverlay.waitFor({ state: 'hidden', timeout: 5000 });

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_mobile_menu_closed.png'));

    const isMenuClosed = await mobileMenuOverlay.isHidden();

    return {
      success: true,
      action: "Successfully opened, verified, and closed the mobile navigation menu.",
      extractedData: {
        menuOpenedSuccessfully: isMenuOpen,
        verifiedMenuItemText: electronicsLinkText.trim(),
        menuClosedSuccessfully: isMenuClosed
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
